import  "./Rating.css";

import React, { useState } from 'react';

const Rating = ({ onSubmit, initialRating = 0, disabled = false }) => {
    const [rating, setRating] = useState(initialRating);
    const levels = [
        "Terrible",
        "Bad",
        "Okay",
        "Good",
        "Excellent",
    ];
    const maxRating = 5;

    const handleRatingChange = (newRating) => {
        if (!disabled) {
            setRating(newRating);
        }
    };

    const handleSubmit = () => {
        onSubmit(rating);
    };

    return (
        <div className="flex flex-col items-center gap-4">
            <div className="flex flex-col items-center">
                <div className="flex gap-2">
                    {Array.from({ length: maxRating }).map((_, index) => (
                        <button
                            key={index}
                            onClick={() => handleRatingChange(index + 1)}
                            className={
                                "transition-colors duration-200 " +
                                "p-1 rounded-full " +
                                "focus:outline-none focus:ring-2 focus:ring-yellow-400 " +
                                (index + 1 <= rating
                                    ? "text-yellow-400 "
                                    : "text-gray-400 hover:text-yellow-300 ") +
                                (disabled ? "cursor-not-allowed opacity-50 hover:text-gray-400" : "")
                            }
                            disabled={disabled}
                            aria-label={`Rate ${levels[index]}`}
                        >
                            <svg
                                xmlns="http://www.w3.org/2000/svg"
                                viewBox="0 0 24 24"
                                fill="none"
                                stroke="currentColor"
                                strokeWidth="2"
                                strokeLinecap="round"
                                strokeLinejoin="round"
                                className="h-6 w-6"
                            >
                                <polygon points="12 2 15.09 8.26 22 9.27 17 14.14 18.18 21.02 12 17.77 5.82 21.02 7 14.14 2 9.27 8.91 8.26 12 2"></polygon>
                            </svg>
                        </button>
                    ))}
                </div>
                <div className="text-sm mt-2 text-gray-300">
                    {levels[rating - 1] || "Select a rating"}
                </div>
            </div>

            <button
                onClick={handleSubmit}
                disabled={disabled || rating === 0}
                className={
                    "bg-yellow-500 text-gray-900 px-6 py-2 rounded-full " +
                    "hover:bg-yellow-600 transition-colors duration-200 " +
                    (disabled ? "opacity-50 cursor-not-allowed " : "") +
                    "focus:outline-none focus:ring-2 focus:ring-yellow-400 focus:ring-offset-2"
                }
            >
                Submit Rating
            </button>
        </div>
    );
};

const FeedbackComponent = () => {
    const handleRatingSubmit = (rating) => {
        const apiUrl = '/api/feedback';

        console.log(`Submitting rating: ${rating} to ${apiUrl}`);

        alert(`Thank you for your feedback! You rated us ${rating}/5.`);
    };

    return (
        <div className="min-h-screen bg-gradient-to-br from-gray-900 to-black flex items-center justify-center p-4">
            <div className="bg-gray-800/80 backdrop-blur-md rounded-xl shadow-lg p-8 border border-gray-700 w-full max-w-md">
                <h2 className="text-2xl font-semibold text-white mb-6 text-center">
                    Rate Your Experience
                </h2>
                <Rating onSubmit={handleRatingSubmit} />
            </div>
        </div>
    );
};

export default FeedbackComponent;
